  \"2016-07-27T23:05:54.623420\",\n\t\"name\": \"initial-survey-instructions-for-columbian-white-tailed-deer-flir-efficacy-monitoring\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Recovery of the lower Columbia population
  of Columbian White-tailed Deer (CWTD) relies on specific population goals.  As such,
  monitoring programs cannot be based on trend analysis or indices, but must yield
  population estimates.  FLIR videography offers one of the most efficient and accurate
  ways to estimate deer populations in Refuge Habitat.  However FLIR accuracy varies
  with camera type, habitat type, and ground conditions.  To obtain accurate estimates,
  FLIR must be ground-truthed periodically using a known quantity, so that a correction
  factor can be calculated for each habitat type.\",\n\t\"license_title\": \"License
